import Link from 'next/link'
import { useEffect, useState } from 'react'

const ArchiveList = ({ eventList }) => {

  console.log(eventList)
  return (
    <div className="archive__list">
      {eventList.map((event) => (
        <a className="archive__list__event" href={event.link} style={{backgroundImage: `url(${event.thumbnail})`}}>
          <p>{event.theme}<br/>{event.date}</p>
        </a>
      ))}
    </div>
  )
}

export default ArchiveList
